import React from "react";
import TeamMember from "./TeamMember";

function Team () {
    return(
        <div className="row">
            <TeamMember name ='Nour'/>
            <TeamMember name ='Majed'/>
            <TeamMember name ='Anass'/>
        </div>
    )
}

export default Team;
